import React from "react";
import HighlightIcon from "@material-ui/icons/Highlight";
const auth = getAuth();
signOut(auth).then(() => {
  // Sign-out successful.
}).catch((error) => {
  // An error happened.
});

function Header() {
  return (
    <header>
      <div>
        {" "}
        <h1>
          {" "}
          <HighlightIcon /> Keeper{" "}
          <i className="bi bi-box-arrow-right header_icon"></i>
        </h1>{" "}
      </div>
    </header>
  );
}

export default Header;
